  return (
    <article className='book'>
      <Image></Image>
      <Title />
      <Author />
    </article>
  )
}
const Image = () => (
  <img
    src='https://m.media-amazon.com/images/I/91hIsjFuICL._AC_UL640_FMwebp_QL65_.jpg'
    alt=''
  />
)

